import Vue from 'vue'
import Router from 'vue-router'
import Home from '@/pages/home/Home'
Vue.use(Router);
export default new Router({
	mode: 'history',
	routes: [
		{
			path: '/',
			name: '',
			component: Home,
		},
		{
			path: '/:path',
			name: '',
			component: Home,
		},
	]
})
